import Skeleton, { SkeletonTheme } from "react-loading-skeleton";
import "../pages/movies.css";
const Smovies = () => {
  return (
    <>
      <div className="card">
        <div className="img">
          {
            <SkeletonTheme
              color="#232423"
              highlightColor="#fff"
            ></SkeletonTheme>
          }
          <img src="./images/space.jpg" alt=""></img>
        </div>
        <h2 className="title">Hello</h2>
      </div>
      <div className="card">
        <div className="img">
          {<Skeleton height={400} />}
          <img src="./images/space.jpg" alt=""></img>
        </div>
        <h2 className="title">Hello</h2>
      </div>
      <div className="card">
        <div className="img">
          {<Skeleton height={400} />}
          <img src="./images/space.jpg" alt=""></img>
        </div>
        <h2 className="title">Hello</h2>
      </div>
    </>
  );
};

export default Smovies;
